As discussed above , the Channel type is expected to be populated with Frame s using its Channel::add_frame method. Below we demonstrate constructing a minimal Channel using a few frames. use maili_protocol::{Channel, Frame}; // Construct a channel at the given L1 block.
let id = [0xee; 16];
let block = BlockInfo::default();
let mut channel = Channel::new(id, block); // The channel will consist of 3 frames.
let frame_0 = Frame { id: [0xee; 16], number: 0, ..Default::default() };
let frame_1 = Frame { id: [0xee; 16], number: 1, ..Default::default() };
let frame_2 = Frame { id: [0xee; 16], number: 2, is_last: true, ..Default::default() }; // Add the frames to the channel.
channel.add_frame(frame_0);
channel.add_frame(frame_1);
channel.add_frame(frame_2); // Since the last frame was ingested,
// the channel should be ready.
assert!(channel.is_ready()); There are a few rules when adding a Frame to a Channel . The Frame 's id must be the same ChannelId as the Channel s. Frame s cannot be added once a Channel is closed. Frame s within a Channel must have distinct numbers. Notice, Frame s can be added out-of-order so long as the Channel is still open, and the frame hasn't already been added.

